import React from 'react';
import { Link } from "react-router-dom";
import somethinglong from '../resources/somethinglong.gif';
import './Navbar.css';
// import SearchBar from './components/SearchBar.js';
import "bootstrap/dist/css/bootstrap.min.css";
// import { MDBCol } from "mdbreact";
import SearchPage from './SearchPage';

function Navbar() {
    return (
        <nav id="navbar" class="navbar navbar-expand-lg navbar-light fixed-top"> 
        <div class="container-fluid">     
          <img class="navbar-brand" src = {somethinglong} />
          {/* <img class="navbar-brand" src={somethingbr}/> */}
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav ms-auto mb-2 mb-lg-0">
              <li class="nav-item">
                <Link class="nav-link active" aria-current="page" to = "./">Home</Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to ="./books" >Books</Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to ="./bookclub">Book Club</Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to ="./reviews">Reviews</Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to ="./about">About Us</Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to ="./contact">Contact Us</Link>
                </li>
              <li class="nav-item">
                <Link class="nav-link" to ="./contact">Profile</Link>
                </li>
              <li class="nav-item">
                <SearchPage/>
                </li>
            </ul>
          </div>
        </div>
      </nav>
    )
}




// function SearchBar() {
